import React, { useState, useEffect } from "react";

import { useParams } from "react-router-dom";
import { coc2016, yng, viaf, doh, gutsy, heartfit } from ".";

export default function Contents({ match, history }) {
  let { contentsId } = useParams();
  const [loading, setLoading] = useState(false);

  console.log("is Loading?: " + loading);

  useEffect(() => {}, [loading]);

  switch (contentsId) {
    case "coc2016":
      return coc2016({ match, history });

    case "yng":
      return yng({ match, history });

    case "viaf2021":
      return viaf({ match, history });

    case "gutsy":
      return gutsy({ match, history });

    case "heartfit":
      return heartfit({ match, history });

    case "doh":
      return doh({ match, history });

    default:
      //return 404;
      return <div> 404 NOT FOUND. </div>;
  }
  setLoading(true);
}
